def electricPay(pay):

    if pay &lt; 100:
        fee = 410 + 100*pay
    elif 100&lt;= pay &lt;=200:
        fee = 910 + 60.7*100 + (fee-100)*125.9
    else:
        fee = 1600 + 60.7 *100 + 100 * 125.9 + (fee-200)*187.9
    return int(fee)

