def solution(left, right):
    for i in range(left, right+1):
        for j in range(1, i+1):
            cnt = 0
            if i % j ==0:
                cnt = cnt +1
    sum = 0
    if cnt %2 == 0:
        sum = sum + i
    else:
        sum = sum - i
