b=int(input("정수를 입력하세요:"))

def sol(a,b):
    if a&gt;b:
        min = b
    else:
        min = a

    for i in range(min, 0 , -1):
        if a%i == 0 and b%i == 0:
            answer = i
            break

    return answer

print(f'{sol(a,b)}')

