a=int(input("정수를 입력하세요:"))
b=int(input("정수를 입력하세요:"))

def sol(a,b):
    if a&gt;b:
        max = a
    else:
        max = b

    for i in range(max,a*b+1):
        if a%i == 0 and b%i == 0:
            result=i
            break

    return result

print(f'{sol(a,b)}')

